import React, { useEffect, useState } from 'react'
import "./Iphone11.css"
import Box from '@mui/material/Box';
import Card from '@mui/material/Card';
import CardContent from '@mui/material/CardContent';
import Button from '@mui/material/Button';
import Typography from '@mui/material/Typography';
import { MenuItem, Select } from '@mui/material';
import Alert from '@mui/material/Alert';
import Stack from '@mui/material/Stack';


function Iphone11() {

    const [iphone,setIphone] = useState()
    const [success,setSuccess] = useState()


    //    const getIphone = async ()=>{
    //     const url = "http://localhost:5000/iphone/iphone11"

    //     const response = await fetch(url);
    //     const responseJson = await response.json();

    //     setIphone(responseJson.iphone)
    // }

    const addCart = ()=>{
        const size = "black"
        const gb = "128"

        if(size === "black" && gb === "128"){
         setSuccess(false)
        }else{
          setSuccess(true)
        }

    }

        // useEffect(()=>{
        //   getIphone()
        // },[])

  return (

  <div className='choose'>
   <Box sx={{ minWidth: 275 }}>
      <Card variant="outlined">
      <CardContent>
      <Typography  variant="h5" color="text.secondary" gutterBottom>
       בחר צבע:
      </Typography>
      <Select
    labelId="demo-simple-select-label"
    id="demo-simple-select"
    label="בחר צבע:"

  >
    <MenuItem style={{background:"red"}} value={"RED(PRODUCT)"}>RED(PRODUCT)</MenuItem>
    <MenuItem style={{background:"#2B333D"}} value={"Midnight"}>Midnight</MenuItem>
    <MenuItem style={{background:"#FFFACD"}} value={"Yellow"}>Yellow</MenuItem>
    <MenuItem style={{background:"#D8BFD8	"}} value={"Purple"}>Purple</MenuItem>
  </Select>


    </CardContent>


    <CardContent>
      <Typography  variant="h5" color="text.secondary" gutterBottom>
      בחר זיכרון:
      </Typography>
      <Select
    labelId="demo-simple-select-label"
    id="demo-simple-select"
    label="בחר זיכרון:"
  >
    <MenuItem value={"128GB"}>128GB</MenuItem>
    <MenuItem value={"256GB"}>256GB</MenuItem>
    <MenuItem value={"512GB"}>512GB</MenuItem>
    <MenuItem value={"1TB"}>1TB</MenuItem>
  </Select>

    </CardContent>
    </Card>
    {!success ?  <Stack sx={{ width: '100%' }} spacing={2}>

      <Button onClick={addCart} variant="contained">להוסיף לסל</Button>


    </Stack> : null

  }

    </Box>



  </div>
  )
}

export default Iphone11
